  [],\n\t\"revision_timestamp\": \"2015-11-25T10:53:20.322612\",\n\t\"name\": \"tracking-audit-consolidated-system\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The TRACS System will be used by Chief Financial
  Operations (CFO) and Office of Acquisition and Assistance (OAA) (in Washington)
  and Foreign Missions (FM) (at the Missions) to do the following, automatically generate
  required audit case folders when contracts for vendors/grantees are obligated, the
  sources of the information to identify, create, and update the audit folders will
  be based on Phoenix Viewer data, the population of open audit folders themselves
  (there may be multiple types required) will represent the audit plan for the upcoming
  12 month time period, the folders will permit the recording of tracking/status information
  as well as provide a repository for all artifacts (documents) related to the planning,
  execution, and results of a specific audit, the system should facilitate coordination
  with CFO/Audit Performance & Compliance (APC) with regards to audit items (such
  as, Inspector General (IG) Audit Recommendations) which are tracked in common between
  both the Mission and APC, the system should provide flexible and extensible reporting
  capability with a base set of canned reports.\",\n\t\"license_title\": \"Other License
